/*!

=========================================================
* Argon Dashboard React - v1.2.4
=========================================================

* Product Page: https://www.creative-tim.com/product/argon-dashboard-react
* Copyright 2024 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/argon-dashboard-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import { useState } from "react";
// react component that copies the given text inside your clipboard
import { CopyToClipboard } from "react-copy-to-clipboard";
// reactstrap components
import {
  Card,
  CardHeader,
  CardBody,
  Container,
  Row,
  Col,
  Form,
  FormGroup,
  Input,
  Label,
  Button,
  Alert,
  UncontrolledTooltip,
} from "reactstrap";
// core components
import Header from "components/Headers/Header.js";

const MesureForm = () => {
  const [formData, setFormData] = useState({
    valeurIMC: "",
    caloriesConsommees: "",
    mesure: ""
  });
  const [alert, setAlert] = useState({ visible: false, message: "", color: "" });

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    const sparqlQuery = `
      PREFIX sh: <http://www.smarthealth-tracker.com/ontologie#>
      PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

      INSERT DATA {
        sh:mesure_${Date.now()} a sh:Mesure ;
                   sh:aValeurIMC "${formData.valeurIMC}"^^xsd:decimal ;
                   sh:aCaloriesConsommées "${formData.caloriesConsommees}"^^xsd:integer ;
                   sh:aMesure "${formData.mesure}"^^xsd:integer .
      }
    `;

    try {
      const response = await fetch('/SmartHealth/update', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/sparql-update',
        },
        body: sparqlQuery
      });

      if (response.ok) {
        setAlert({
          visible: true,
          message: "Mesure ajoutée avec succès!",
          color: "success"
        });
        setFormData({ valeurIMC: "", caloriesConsommees: "", mesure: "" });
      } else {
        throw new Error('Erreur lors de l\'insertion');
      }
    } catch (error) {
      setAlert({
        visible: true,
        message: "Erreur: " + error.message,
        color: "danger"
      });
    }
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  return (
    <>
      <Header />
      <Container className="mt--7" fluid>
        <Row>
          <Col lg="6">
            <Card className="shadow">
              <CardHeader className="bg-transparent">
                <h3 className="mb-0">Nouvelle Mesure</h3>
              </CardHeader>
              <CardBody>
                {alert.visible && (
                  <Alert color={alert.color} dismissible>
                    {alert.message}
                  </Alert>
                )}
                <Form onSubmit={handleSubmit}>
                  <FormGroup>
                    <Label for="valeurIMC">IMC</Label>
                    <Input
                      type="number"
                      step="0.1"
                      name="valeurIMC"
                      id="valeurIMC"
                      placeholder="Ex: 24.5"
                      value={formData.valeurIMC}
                      onChange={handleChange}
                      required
                    />
                  </FormGroup>
                  <FormGroup>
                    <Label for="caloriesConsommees">Calories Consommées</Label>
                    <Input
                      type="number"
                      name="caloriesConsommees"
                      id="caloriesConsommees"
                      placeholder="Ex: 2000"
                      value={formData.caloriesConsommees}
                      onChange={handleChange}
                      required
                    />
                  </FormGroup>
                  <FormGroup>
                    <Label for="mesure">Mesure (Pas ou autre)</Label>
                    <Input
                      type="number"
                      name="mesure"
                      id="mesure"
                      placeholder="Ex: 75"
                      value={formData.mesure}
                      onChange={handleChange}
                      required
                    />
                  </FormGroup>
                  <Button color="primary" type="submit">
                    Ajouter la Mesure
                  </Button>
                </Form>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default MesureForm;
